NOTIFICATION TO PARENTS of INTERNET CLASS SESSIONS AND PLATFORMS
Dear Frontier Parents and Guardians;
As we transition to distance learning, we will be using various online platforms for instruction and virtual class meetings. Students may be asked to join a virtual class session where he/she will meet with teachers and classmates. For example, teachers may ask students to join a Google virtual meeting in order to provide a “read aloud” activity or assist with “real time” instruction. We will continue to adhere to FERPA and safety guidelines and only authorized users will be able to access these meetings. However, we ask that you help us assure your child’s safety even further by monitoring their screen time as best as possible. We are excited to provide them with these new opportunities for learning and hope you will assist us in their success.

